package com.skysport.inerfaces.bean;import com.skysport.core.bean.CommonBean;public class MaterialClassicInfo extends CommonBean {    private String id;    private String classicId;    private String classicName;    private String materialTypeId;    private String delFalg;    private String updateTime;    public void setId(String id) {        this.id = id;    }    public void setClassicId(String classicId) {        this.classicId = classicId;    }    public void setClassicName(String classicName) {        this.classicName = classicName;    }    public void setMaterialTypeId(String materialTypeId) {        this.materialTypeId = materialTypeId;    }    public void setDelFalg(String delFalg) {        this.delFalg = delFalg;    }    public void setUpdateTime(String updateTime) {        this.updateTime = updateTime;    }    public String getId() {        return id;    }    public String getClassicId() {        return classicId;    }    public String getClassicName() {        return classicName;    }    public String getMaterialTypeId() {        return materialTypeId;    }    public String getDelFalg() {        return delFalg;    }    public String getUpdateTime() {        return updateTime;    }}